message:
BNDES é uma empresa pública, ou seja, todos os valores de que eles dispõem são dinheiro público, arrecadado principalmente através dos impostos pagos pela sociedade. 

Uma das maiores fontes de recursos do BNDES é o Tesouro Nacional; depois vem o Fundo de Amparo ao Trabalhador (FAT) e o PIS-PASEP (Programa de Integração Social e Programa de Formação do Patrimônio do Servidor Público), tributos cobrados sobre as empresas para garantir fundos aos seus empregados ou servidores.
